import React from "react";
import { Typography, Box, Button, Avatar } from "@material-ui/core";
import TextField from "@material-ui/core/TextField";
import { Formik } from "formik";

const Index = () => {
  return (
    <div>
      <Box
        style={{
          marginTop: "10%",
          marginLeft: "450px",
          borderRadius: "5px",
          textAlign: "center",
          width: "400px",
          height: "350px",
          backgroundColor: "#F7F7F7",
        }}
      >
        <Typography style={{ fontSize: "35px" }}>Log in</Typography>
        <input></input>
        <TextField
          style={{ margintop: "50px" }}
          id="standard-basic"
          label="Standard"
        />
        <TextField
          style={{ margintop: "50px" }}
          id="standard-basic"
          label="Standard"
        />
        <Box >
          <Button  variant="contained" color="primary">
            Primary
          </Button>
        </Box>
      </Box>
    </div>
  );
};
export default Index;
